INSERT INTO SPR_PS
	VALUES ("c96ec02d-a35a-4820-a6f8-96dbe90fdf6b",
	'CreateLeaveSpecification',
	'',
	'
select any leaveSpec from instances of LeaveSpecification where selected.Name==param.Name;

if ( empty leaveSpec)
		create object instance leaveSpecification of LeaveSpecification;
		leaveSpecification.Name = param.Name;
		leaveSpecification.MaximumDays = param.MaximumDays;
		leaveSpecification.MinimumDays = param.MinimumDays;
		
		UI::Reply( msg:"Leave added successfully.", state:True);

else
// if it exists update
		leaveSpec.Name = param.Name;
		leaveSpec.MaximumDays = param.MaximumDays;
		leaveSpec.MinimumDays = param.MinimumDays;
		
		UI::Reply( msg:"Leave updated successfully.", state:True);


end if;
',
	1,
	0);
