INSERT INTO SPR_PS
	VALUES ("c65b4b9d-191c-477e-a438-8b1a44ed89af",
	'ReadEmployeeMessage',
	'',
	'select any employee from instances of Employee where selected.EmployeeID==param.EmployeeID; 

select many msgSet related by employee->ApproveLeave[R102.''is notified by''];  

 
LOG::LogInfo(message:"Sending employee message set .." );	


  for each msg in msgSet
 
