INSERT INTO SPR_PS
	VALUES ("43f64cdc-12fd-43b3-a2f5-ecc36159956f",
	'ReadScales',
	'',
	'select many scales from instances of Scale;

if (not empty scales) 
	LOG::LogInfo(message:"Sending scales list .." );	
	
	for each scale in scales
			UI::SendScales( Name:scale.Name, Description:scale.Description)	;	
			LOG::LogInfo(message:"Sent: Scale "+ scale.Name+", Description:"+scale.Description);
	end for;

  LOG::LogInfo(message:"Sending scales list is complete" );	
  
  else 
  	LOG::LogInfo(message:"There are no scales registered in the system" );	
  	UI::Reply( msg:"There are no scales registered in the system", state:False );  
  end if; ',
	1,
	0);
