INSERT INTO SPR_PS
	VALUES ("f7ae468f-3e6b-4807-9a46-cb2969209223",
	'GetSalaryStructure',
	'',
	'
select any employee from instances of Employee where selected.EmployeeID == param.EmployeeID;
select many bonuses related by employee->Bonus[R4.''gets a''] ; //where selected.Name==param.Name;

 
 if (not empty employee) and (not empty bonuses)
  LOG::LogInfo(message:"Sending salary structure set .. ");

   for each bonus in bonuses
  	select one bonusSpec related by bonus->BonusSpecification[R16.''is specified by''];
  	amount = bonusSpec.Percent * employee.getSalary();
	UI::SendSalaryStructure(EmployeeSalary:employee.getSalary(), BonusName:bonusSpec.Name, BonusAmount:amount);
	LOG::LogReal(message:"Salary Structure: Salary: ", r: employee.getSalary());
	LOG::LogInfo( message:"Bonus Name: "+ bonusSpec.Name );
	LOG::LogReal(message:"Bonus Amount: ", r:amount);

	//UI::Reply( msg:"Sent: "+bonusSpec.Name, state:True);

   end for;
  
  elif (not empty employee)
  		UI::SendSalaryStructure(EmployeeSalary:employee.getSalary(), BonusName:"", BonusAmount:0);
		LOG::LogReal(message:"Salary Structure: Salary: ", r: employee.getSalary());

  else
  	  	UI::Reply( msg:"Could not find Employee or Salary Structure ", state:False);
  	  	LOG::LogInfo( message:"Could not find Employee or Salary Structure ");
  end if;
',
	1,
	0);
