INSERT INTO SPR_PS
	VALUES ("d01ede9a-4395-431b-91e2-37c109dbe24f",
	'ChangePassword',
	'',
	'select any account from instances of Account where selected.Username==param.Username and selected.Password==param.OldPassword;

if (not empty account) 
	account.Password = param.NewPassword;
	UI::Reply(EmployeeID:account.EmployeeID,Username:account.Username, msg:"Password changed successfully", state:True );
	LOG::LogInfo(message:"UI: Password changed successfully."+" Username "+account.Username);	

else 
	LOG::LogInfo(message:"UI: Password changed unsuccessful. Wrong username or password"+" Username "+param.Username);	
	UI::Reply(EmployeeID:0, Username:param.Username, msg:"Wrong username or password", state:False );


end if;
	
',
	1,
	0);
