INSERT INTO SPR_PS
	VALUES ("6d8f28a6-f174-4e38-9d54-c4b2f9162417",
	'AcceptCeiling',
	'',
	'
select any account from instances of AccountSpecification where selected.Code == param.Code; 

if (not empty account)
	select many budgets related by account->Account[R20.''budgetize''];
	if (not empty budgets)
		for each budget in budgets
			select one ceiling related by budget->Ceiling[R19];
			//select one requested related by budget->Requested[R19];
			if (not empty ceiling)
				generate Account1:Accept to budget;
			else
				generate Account2:Reject to budget;
			end if;
		end for;
	end if;
end if;
',
	1,
	0);
