	VALUES ("1a383467-1437-496b-93f2-f4b604b00b54",
	'RecordSalaryEntry',
	'',
	'
select any journal from instances of Journal where selected.Name == "Salary";
create object instance entry of Entry;
entry.Date = param.Date;
entry.Description = param.Description;
create object instance amount of Amount;
amount.Amount = param.Amount;
relate entry to amount across R4;

select one column related by journal->Column[R16.''has single''];
relate amount to column across R13;
select one debit related by column->AccountSpecification[R14.''debits'']->Account[R17.''operates''];
select one credit related by column->AccountSpecification[R15.''credits'']->Account[R17.''operates''];

relate amount to debit across R3.''debits'';
relate amount to credit across R5.''credits'';
',
	1,
	0);
