expenseCieling.Revenue= 0;

relate expenseCieling to section across R105.''specified by'';
relate expenseCieling to account across R116.''requested by ceilling'';

 
create object instance account of AccountSpecification;
account.Code = "٣١";
account.Name="أصول غير مالية";

::CreatePEI_Chapter21();
::CreatePEI_Chapter22();

