INSERT INTO SPR_PS
	VALUES ("8fe9881c-eb15-43c5-b146-5d86fafe4e6f",
	'ReadMilestones',
	'Get a list of milestones related to
an initiative. One parameter is enough
to identify the initiative.',
	'select any initiative from instances of Initiative where selected.Name ==param.InitiativeName or selected.LongNumber==param.InitiativeLongNumber or selected.ShortNumber==param.InitiativeShortNumber; 
select many milestones related by initiative->Milestone[R60.''achieves'']; 
if (not empty milestones)
	LOG::LogInfo(message:"Sending milestone set .. ");
	for each milestone in milestones
		UI::SendMilestones( Name:milestone.Name, FullCode:milestone.FullCode, Code:milestone.Code, Type:milestone.Type, SuccessCriteria:milestone.SuccessCriteria, CompletePlanned:milestone.CompletePlanned, CompleteActual:milestone.CompleteActual, Complete:milestone.Complete, Weight:milestone.Weight, Percentage:milestone.Percentage, sdState:milestone.sdState, sdDescription:milestone.sdDescription, Notes:milestone.Notes, IncompleteReasons:milestone.IncompleteReasons );
		LOG::LogInfo(message:"Milestone: Name "+milestone.Name+", Code: "+milestone.Code);
	end for;
	LOG::LogInfo(message:"Sending milestone set is complete. ");

else
	LOG::LogInfo(message:"Milestone: No milestones found in the system ");

end if;
',
	1,
	0);
